2803887722080936828=<ph name="BEGIN_H3">Funkcije za odpravljanje napak<ph name="END_H3"><br>    <ph name="BR"><br>    Če želite v napravi s sistemom Chrome OS namestiti in preskusiti kodo po meri, lahko v njej omogočite funkcije za odpravljanje napak. S tem boste lahko:<ph name="BR"><br>    <ph name="BEGIN_LIST"><br>      <ph name="LIST_ITEM">odstranili preverjanje »rootfs«, tako da boste lahko spreminjali datoteke operacijskega sistema;<br>      <ph name="LIST_ITEM">omogočili dostop do naprave s protokolom SSH s standardnimi preskusnimi kjuči, tako da boste lahko za dostop do naprave uporabljali orodja, kot je <ph name="BEGIN_CODE">»cros flash«<ph name="END_CODE">;<br>      <ph name="LIST_ITEM">omogočili zaganjanje s pogona USB, tako da boste lahko namestili sliko operacijskega sistema s pogona USB;<br>      <ph name="LIST_ITEM">nastavili geslo za prijavo v razvijalski kanal in sistemsko korensko geslo na vrednost po meri, tako da boste imeli na voljo ročni dostop do naprave s protokolom SSH;<br>    <ph name="END_LIST"><br>    <ph name="BR"><br>    Ko so funkcije za odpravljanje napak omogočene, jih bo večina ostala omogočena tudi po izvedbi funkcije Powerwash ali brisanju podatkov v napravi, ki jo upravljajo v podjetju. Če želite v celoti onemogočiti vse funkcije za odpravljanje napak, dokončajte postopek obnovitve sistema Chrome OS (https://support.google.com/chromebook/answer/1080595).<br>    <ph name="BR"><br>    <ph name="BR"><br>    Če želite več informacij o funkcijah za odpravljanje napak, glejte:<ph name="BR"><br>    http://www.chromium.org/chromium-os/how-tos-and-troubleshooting/debugging-features<br>    <ph name="BR"><br>    <ph name="BR"><br>    <ph name="BEGIN_BOLD">Opomba:<ph name="END_BOLD"> Sistem se bo med postopkom znova zagnal.</ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph>
